Maria tinha 10 reais e gastou 4. Quanto sobrou?

#include <stdio.h>

int main()
{
    int reais, gasto, sobra;

    printf("Digite o valor de reais: ");
    scanf("%d", &reais);
    printf("Digite o valor gasto: ");
    scanf("%d", &gasto);

    sobra = reais - gasto;

    printf("Sobrou %d reais", sobra);

    return 0;
}

