Implemente uma função que calcula o fatorial de n.

#include <stdio.h>

unsigned long long int fatorial(int n) {
    if (n == 0)
        return 1;
    else
        return n * fatorial(n - 1);
}

int main() {
    int n;
    scanf("%d", &n);
    printf("%llu\n", fatorial(n));
    return 0;
}

