Escreva uma função que conta vogais em uma string.

function contarVogais(string) {
    let vogais = 'aeiouAEIOU';
    let contador = 0;

    for (let i = 0; i < string.length; i++) {
        if (vogais.indexOf(string[i]) !== -1) {
            contador++;
        }
    }

    return contador;
}

